function getObrazok(obr) {
    $("#debug_info_samostatne").prepend(' <br>getObrazok<br>');

    //  $("#debug_info_samostatne").append('getLabel:->' + jazyk + '<br>');


    var tnvDB = window.sqlitePlugin.openDatabase({ name: "obr.db", location: 'default' });
    var sql = 'SELECT * FROM obrazky WHERE id="' + obr + '" ';
    $("#debug_info_samostatne").prepend(sql);
    tnvDB.transaction(function (transaction) {
        transaction.executeSql(sql, [], function (tx, results) {

            var len = results.rows.length, i;
            $("#rowCount_samostatne").append(len);

            $("#debug_info_samostatne").prepend(results);
            $("#debug_info_samostatne").prepend(' <br>' + results.rows.item(0).data + '<br>');
            $("#debug_info_samostatne").prepend(' <br>  <img src="' + results.rows.item(0).data + '"  /><br>');


        }, function (error) {
            $("#debug_info_samostatne").prepend(' <br>' + "Problem z tabulkou labels: " + error + '<br>');
        });

    });

}

