function getPodData(typ) {


    var strDB = window.sqlitePlugin.openDatabase({ name: "str.db", location: 'default' }); //`jazyk` (`id` int (11),`typ` varchar (50),`aktivne` int (1),`aktualizovane` bigint (20))",

    var sql = 'SELECT  `typ`,`aktivne` FROM `strany`  '; //`id`, `typ`,`aktivne`,`aktualizovane`

    strDB.transaction(function (trans) {
        trans.executeSql(sql, [], function (tx, results) {
            skStrana = results.rows.item(0).aktivne;
            plStrana = results.rows.item(1).aktivne;

            $("#debug_info_samostatne").append("Strany OK<br>");
            $("#debug_info_samostatne").append("Slovenska strany:" + skStrana + '<br>');
            $("#debug_info_samostatne").append("Polska strany:" + plStrana + '<br>');
            getPodData2(typ, skStrana, plStrana);
        },
            function (error) {
                $("#debug_info_samostatne").append("error tabulka strany(x)" + '<br>');

            });
    });


}
function getPodData2(typ, skStrana, plStrana) {
    var strany = '';
    if (skStrana == 'ano' && plStrana == 'ano') {
        strany = ' AND strana IN ("PL","SK") ';
    }
    if (skStrana == 'nie' && plStrana == 'ano') {
        strany = ' AND  strana = "PL" ';
    }
    if (skStrana == 'ano' && plStrana == 'nie') {
        strany = ' AND strana = "SK" ';
    }
    if (skStrana == 'nie' && plStrana == 'nie') {
        strany = '';
    }


    var zvoleny_jazyk = $("#zvoleny_jazyk").text();

    var sqlTyp = '';
    if (typ != '') {
        sqlTyp = ' AND  typ = "' + typ + '"';

    }

    var data = '';
    var images = '';
    var tnvDB = window.sqlitePlugin.openDatabase({ name: "pod.db", location: 'default' });
    var sql = 'SELECT * FROM podujatia where 1=1  ' + sqlTyp + strany;
    $("#debug_info_samostatne").append(sql + "<br>");
    tnvDB.transaction(function (transaction) {
        transaction.executeSql(sql, [], function (tx, results) {



            $("#debug_info_samostatne").append("results<br>");
            var len = results.rows.length, i;
            $("#debug_info_samostatne").append("len" + len + "<br>");
            $("#debug_info_samostatne").append(results.rows.item(0).nazov_sk + "<br>");
            $("#debug_info_samostatne").append(results.rows.item(1).nazov_sk + "<br>");


            for (i = 0; i < len; i++) {




                zvoleny_jazyk = $("#zvoleny_jazyk").text();
                //     $("#debug_info_samostatne").append("getTnvData ->" + zvoleny_jazyk + "<br>");

                switch (zvoleny_jazyk) {
                    case 'sk':
                        var nazov = results.rows.item(i).nazov_sk,
                            popis = results.rows.item(i).popis_sk;
                        $("#debug_info_samostatne").append("switch SK<br>");
                        break;
                    case 'pl':
                        var nazov = results.rows.item(i).nazov_pl,
                            popis = results.rows.item(i).popis_pl;
                        $("#debug_info_samostatne").append("switch PL<br>");
                        break;
                    case 'uk':
                        var nazov = results.rows.item(i).nazov_uk,
                            popis = results.rows.item(i).popis_uk;
                        $("#debug_info_samostatne").append("switch UK<br>");
                        break;
                    default:
                        var nazov = results.rows.item(i).nazov_sk,
                            popis = results.rows.item(i).popis_sk;
                        $("#debug_info_samostatne").append("switch SK<br>");
                }



                var newtimestamp = new Date($.now()).getTime();
                var idecko = 'picture_' + newtimestamp + '_' + i;
                data += ' <article class="polozka_bod_zaujmu" onClick=\'presmeruj("detail_pod.html?id=' + results.rows.item(i).id + '")\'>';
                data += '    <div class="polozka_bod_zaujmu">';
                data += '        <picture id="' + idecko + '">';

                if (results.rows.item(i).obrazky.length <= 2) {
                    data += '                <img src="img/icons/cesta_dukelskeho_hrdinu.png" alt="' + nazov + '" style="margin-left:1em;">';
                } else {
                    //JSON.parse(data);
                    var obrazkySpolu = JSON.parse(results.rows.item(i).obrazky);
                    // var obrazky = obrazkySpolu.split(',');
                    obrazok = obrazkySpolu[0];


                    imagesstr += idecko + '-|-' + obrazok + '+|+';



                    data += '                <img src="img/icons/cesta_dukelskeho_hrdinu.png" alt="' + results.rows.item(i).strana + nazov + '" style="margin-left:1em;">';
                    //    data += '                <img src="https://www.dukladestination.com/wp-content/uploads/2016/05/vojenske-muzeum-svidnik-490x276.jpg" alt="' + nazov + '" width="490" height="276">';
                }

                data += '    </picture>';
                data += '</div>';

                data += '            <div class="texty_bodu_zaujmu">';
                data += '               <h2 class="titulok">' + nazov + '</h2>';
                data += '               <p class="popis">' + popis + '</p>'; //
                data += '           </div>';
                data += '</article>';


                $("#debug_info_samostatne").append(data);

                zobrazene = 1;
            }

            //$("#body_tipy_na_vylet_zoznam").append(data);
            $("#body_tipy_na_vylet_zoznam").html(data);
            addObrazkyPodlaId(imagesstr);
            var texty = $('p.popis');
            $.each(texty, function (index, value) {
                if ($(this).text().length > 80) {
                    $(this).text($(this).text().substr(0, 80) + '...');
                }
            });

        }, function (error) {
            $("#body_tipy_na_vylet_zoznam").append(' <br>' + "Problem z tabulkou aktualizacie: " + error + '<br>');
        });

    });

}

