function setJazyk(typ, ciel) {

    var jazDB = window.sqlitePlugin.openDatabase({ name: "jaz.db", location: 'default' }); //`jazyk` (`id` int (11),`typ` varchar (50),`aktivne` int (1),`aktualizovane` bigint (20))",
    var executeQuery = "UPDATE `jazyk` SET `aktivne` = '0'";
    jazDB.transaction(function (transaction) {
        transaction.executeSql(executeQuery, []
            , function (tx, result) {
                //   $("#debug_info_samostatne").append(' <br>' + 'UPDATE jazyk: ' + typ + ' <br>');
                var executeQuery = "UPDATE `jazyk` SET `aktivne` = '1' WHERE `typ` = '" + typ + "'";
                jazDB.transaction(function (transaction) {
                    transaction.executeSql(executeQuery, []
                        , function (tx, result) {
                            //      $("#debug_info_samostatne").append(' <br>' + 'UPDATE jazyk: ' + typ + ' <br>');
                            presmeruj(ciel);
                        },
                        function (error) {
                            $("#debug_info_samostatne").append(' <br>' + '(2)Error occurred' + error + ' SQL->' + executeQuery + '<br>');
                        });
                });
            },
            function (error) {
                $("#debug_info_samostatne").append(' <br>' + '(2)Error occurred' + error + ' SQL->' + executeQuery + '<br>');
            });
    });
}




