function getLabel(jazyk) {


    //  $("#debug_info_samostatne").append('getLabel:->' + jazyk + '<br>');


    var tnvDB = window.sqlitePlugin.openDatabase({ name: "lab.db", location: 'default' });
    var sql = 'SELECT * FROM labels ';

    tnvDB.transaction(function (transaction) {
        transaction.executeSql(sql, [], function (tx, results) {
            var len = results.rows.length, i;
            // $("#debug_info_samostatne").prepend("labels ->" + len + "<br>");


            var len = results.rows.length, i;
            $("#rowCount").append(len);

            switch (jazyk) {
                case 'sk':
                    for (i = 0; i < len; i++) {
                        //    $("#TableData_samostatne").append("<tr><td>" + results.rows.item(i).id + "</td><td>" + results.rows.item(i).label + "</td><td>" + results.rows.item(i).preklad_sk + "</td></tr>");
                        $('#' + results.rows.item(i).label).text(results.rows.item(i).preklad_sk);
                    }
                    break;
                case 'pl':
                    for (i = 0; i < len; i++) {
                        //    $("#TableData_samostatne").append("<tr><td>" + results.rows.item(i).id + "</td><td>" + results.rows.item(i).label + "</td><td>" + results.rows.item(i).preklad_pl + "</td></tr>");
                        $('#' + results.rows.item(i).label).html(results.rows.item(i).preklad_pl);

                        //    $("#debug_info_samostatne").append(" $('#" + results.rows.item(i).label + "').text(" + results.rows.item(i).preklad_pl+");<br>");
                    }
                    break;
                case 'uk':
                    for (i = 0; i < len; i++) {
                        //     $("#TableData_samostatne").append("<tr><td>" + results.rows.item(i).id + "</td><td>" + results.rows.item(i).label + "</td><td>" + results.rows.item(i).preklad_uk + "</td></tr>");
                        $('#' + results.rows.item(i).label).text(results.rows.item(i).preklad_uk);
                    }
                    break;
                default:
                    for (i = 0; i < len; i++) {
                        //      $("#TableData_samostatne").append("<tr><td>" + results.rows.item(i).id + "</td><td>" + results.rows.item(i).label + "</td><td>" + results.rows.item(i).preklad_sk + "</td></tr>");
                        $('#' + results.rows.item(i).label).text(results.rows.item(i).preklad_sk);
                    }
            }





        }, function (error) {
            $("#debug_info_samostatne").prepend(' <br>' + "Problem z tabulkou labels: " + error + '<br>');
        });

    });

}

